import React from 'react';


function Cal(){
var a=12;
var b=42;
 

var sum =(a+b);
var dev =int(a/b);

var mul =(a*b);
var sub =(a-b);

return <>
 <h1>
     Addtion is ::
     {sum}</h1>
  
 <h1> Sub  is{sub}</h1>
 
 <h1> multi is {mul}</h1>
    
 <h1>
     Division is ::{dev}</h1>
</>;




}

export default Cal;
